svg.script:
function showMask() {
  var pwindow = window.parent;
  var mask = pwindow.document.getElementById('mask');
  mask.style.display = 'block';
  mask.className = '';
  var contactUs = pwindow.document.getElementById('contact');
  contactUs.className = 'contact contact-active';
}

function moveTo(n) {
  var pwindow = window.parent;
  pwindow.scrollTo(0, n);
}
